import './App.css';
import Request from './Request';
import Header from './Header';
import {Routes, Route} from 'react-router-dom'
import Layout from './Layout';

function App() {
  return (
    <Routes>
      <Route path="/" element={<Layout />}>
        <Route index element={
          <Request />
        } />
        <Route path={'/login'} element={<div>Login Page</div>} />
      </Route>
    </Routes>

  );
}

export default App;
